import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { FaArrowLeft, FaCalendar, FaTag, FaServer, FaStar, FaDesktop, FaNetworkWired } from 'react-icons/fa';
import TableOfContents from '../../../components/TableOfContents';
import './FluffyWalkthrough.css';

const FluffyWalkthrough = () => {
  // Fluffy Walkthough data
  const writeup = {
    id: 'Fluffy-walkthrough',
    title: 'Fluffy Walkthough',
    excerpt: 'Fluffy Walkthough - This writeup documents the discovery and analysis of vulnerabilities, exploitation techniques, and privilege escalation methods.',
    date: 'Aug 31, 2025',
    tags: ['Htb', 'Smb', 'Ldap', 'Kerberos', 'Windows', 'Ad'],
    difficulty: 'Medium',
    os: 'Windows',
    ip: '10.10.10.10',
    content: `# Fluffy Walkthough

## Overview
This writeup documents the discovery and analysis of vulnerabilities, exploitation techniques, and privilege escalation methods for the Fluffy Walkthough machine.

## Initial Reconnaissance

### Port Scanning
![Port Scan Results](/writeup-images/Fluffy-images/1.png)

### Service Enumeration
![Service Enumeration](/writeup-images/Fluffy-images/2.png)

## Initial Access

### Exploitation
![Initial Access](/writeup-images/Fluffy-images/3.png)

### User Flag
![User Flag](/writeup-images/Fluffy-images/4.png)

## Privilege Escalation

### Escalation Method
![Privilege Escalation](/writeup-images/Fluffy-images/5.png)

### Root Flag
![Root Flag](/writeup-images/Fluffy-images/6.png)

## Conclusion
This machine demonstrated various Windows exploitation techniques and privilege escalation methods.`
  };

  // Get OS icon URL
  const getOSIcon = (os) => {
    const osLower = os.toLowerCase();
    if (osLower === 'linux') {
      return 'https://skillicons.dev/icons?i=linux';
    } else if (osLower === 'windows') {
      return 'https://skillicons.dev/icons?i=windows';
    }
    return 'https://skillicons.dev/icons?i=linux'; // Default to Linux
  };

  return (
    <motion.div 
      className="writeup-detail-page"
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6 }}
    >
      <div className="writeup-header">
        <Link to="/writeups" className="back-button">
          <FaArrowLeft />
          <span>Back to Writeups</span>
        </Link>

        <motion.div 
          className="writeup-title-section"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.2, duration: 0.6 }}
        >
          <h1>{writeup.title}</h1>

          <div className="writeup-meta">
            <div className="meta-item">
              <FaCalendar />
              <span>{writeup.date}</span>
            </div>
            <div className="meta-item">
              <FaTag />
              <span>Difficulty: {writeup.difficulty}</span>
            </div>
          </div>

          <div className="writeup-tags">
            {writeup.tags.map((tag, index) => (
              <motion.span
                key={tag}
                className="tag-badge"
                initial={{ scale: 0, opacity: 0 }}
                animate={{ scale: 1, opacity: 1 }}
                transition={{ delay: 0.3 + index * 0.1, duration: 0.3 }}
                whileHover={{ scale: 1.1 }}
              >
                {tag}
              </motion.span>
            ))}
          </div>

          <div className="machine-info">
            <div className="machine-info-content">
              <div className="machine-info-left">
                <h6><FaServer /> Machine Information:</h6>
                <div className="machine-badges">
                  <span className="badge bg-info">
                    <img src={getOSIcon(writeup.os)} alt={writeup.os} className="os-icon" />
                    OS: {writeup.os}
                  </span>
                  <span className="badge bg-primary">
                    <FaStar /> Difficulty: {writeup.difficulty}
                  </span>
                  <span className="badge bg-secondary">
                    <FaNetworkWired /> IP: {writeup.ip}
                  </span>
                </div>
              </div>
              <div className="machine-info-right">
                <img src="/writeup-images/Fluffy-machine.png" alt="Fluffy Walkthough" className="machine-image" />
              </div>
            </div>
          </div>
        </motion.div>
      </div>

      <div className="writeup-layout">
        <motion.div 
          className="writeup-content"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.4, duration: 0.6 }}
        >
          <div className="markdown-content">
            {(() => {
              const lines = writeup.content.split('\n');
              const elements = [];
              let i = 0;

              while (i < lines.length) {
                const line = lines[i];

                if (line.startsWith('# ')) {
                  elements.push(<h1 key={i}>{line.substring(2)}</h1>);
                } else if (line.startsWith('## ')) {
                  elements.push(<h2 key={i}>{line.substring(3)}</h2>);
                } else if (line.startsWith('### ')) {
                  elements.push(<h3 key={i}>{line.substring(4)}</h3>);
                } else if (line.startsWith('```')) {
                  // Handle code blocks
                  const language = line.substring(3).trim();
                  const codeLines = [];
                  i++;

                  while (i < lines.length && !lines[i].startsWith('```')) {
                    codeLines.push(lines[i]);
                    i++;
                  }

                  elements.push(
                    <pre key={i}>
                      <code className={language ? `language-${language}` : ''}>
                        {codeLines.join('\n')}
                      </code>
                    </pre>
                  );
                } else if (line.startsWith('![')) {
                  // Handle images
                  const match = line.match(/!\[(.*?)\]\((.*?)\)/);
                  if (match) {
                    const [, alt, src] = match;
                    elements.push(
                      <div key={i} className="image-container">
                        <img src={src} alt={alt} className="writeup-image" />
                        {alt && <p className="image-caption">{alt}</p>}
                      </div>
                    );
                  }
                } else if (line.trim()) {
                  elements.push(<p key={i}>{line}</p>);
                } else {
                  elements.push(<br key={i} />);
                }

                i++;
              }

              return elements;
            })()}
          </div>
        </motion.div>
        <TableOfContents content={writeup.content} />
      </div>
    </motion.div>
  );
};

export default FluffyWalkthrough;
